Acta Sociologica - Volume 48, Issue 3, 2005.

&quot;Acta Sociologica publishes papers on high-quality innovative sociology, carried out from different theoretical and methodological starting points, in the form of full-length original articles and review essays, as well as book reviews and commentaries. Articles that present Nordic sociology or help mediate between Nordic and international scholarly discussions are encouraged.&quot;

